import React from 'react'
import { Image, Menu, Button } from 'semantic-ui-react';
import logo from '../img/Logo-Fablab.png';

const Barrasuperior = () => {
    return (
        <div>
            <Menu>
                    <Menu.Item as="a" header>
                        <Image
                            size="small"
                            src={logo}
                            circular
                        />
                    </Menu.Item>
            </Menu>
        </div>
    )
}

export default Barrasuperior
